process.env.NODE_ENV = "test";

const Posts = require("../models/posts");

const chai = require("chai");
const chaiHttp = require("chai-http");
const server = require("../app");
const should = chai.should();

chai.use(chaiHttp);

const agent = chai.request.agent(server);

const postHelper = { tagsId: [] };

describe("Posts", () => {
  before(async () => {
    await Posts.destroy({
      truncate: {
        cascade: true,
        restartIdentity: true,
      },
    });

    const user = {
      formFields: [
        { id: "email", value: "josephcartaphilus@notrealgmail.com" },
        { id: "password", value: "jcartaphilus12" },
      ],
    };

    await agent.post("/signin").send(user);
  });

  after(function () {
    agent.close();
  });

  describe("/POST create post", () => {
    before(async () => {
      let tagsBody = [
        {
          nama: "kesehatan",
          deskripsi:
            "Info kesehatan, tips kecantikan, seksualitas, diet sehat, info nutrisi, dan tips-tips kesehatan lainnya.",
          warna: "#84d369",
        },
        {
          nama: "keluarga",
          deskripsi:
            "Info kesejahteraan keluarga, kesehatan bayi dan tumbuh kembang anak, tips menjaga keharmonisan keluarga.",
          warna: "#9e6add",
        },
      ];

      for (const tagBody of tagsBody) {
        await agent
          .post("/tags")
          .send(tagBody)
          .then((res) => {
            postHelper.tagsId.push(res.body.data.id);
          });
      }
    });

    it("should POST on correct post request body", (done) => {
      const body = {
        postTitle: "Memahami Alergen pada Makanan Anak",
        postContent:
          "<p>Teknologi pangan yang semakin maju kini banyak menghasilkan makanan kemasan cepat saji dan instan. Dalam produk yang bisa bertahan lama, tentu banyak ditambahkan bahan kimia guna memperpanjang umur simpan maupun menambah cita rasa.</p> <p>Sebagai konsumen, tidak semua orang teliti membaca bahan-bahan yang terkandung pada makanan dan tertulis di kemasan. Pasalnya, jika seseorang alergi terhadap makanan tertentu seperti kacang atau susu, makanan kemasan yang sudah diproses tersebut akan sulit dikenali dari bentuk dan rasanya kecuali jika membaca bahan yang tertulis di kemasan.</p>",
        postCover:
          "",
        tags: [postHelper.tagsId[0], postHelper.tagsId[1]],
      };

      agent
        .post("/posts")
        .send(body)
        .end((err, res) => {
          res.should.have.status(200);
          res.body.should.be.a("object");
          res.body.should.have
            .property("message")
            .eql("Successfully creating post!");
          res.body.should.have.property("data");
          res.body.data.should.have
            .property("slug")
            .match(/^memahami-alergen-pada-makanan-anak-/);
          done();
        });
    });

    it("should POST even if cover is not provided", (done) => {
      const body = {
        postTitle: "Dampak Psikologis Anak Tanpa Ibu dan Cara Mengatasinya",
        postContent:
          "<p>Ayah dan ibu memiliki peranan yang berbeda dan keduanya sama penting dalam pengasuhan anak. Bila salah satu atau keduanya tidak hadir dalam hidup anak, tentunya akan memberikan efek psikologis tertentu. Apa saja dampak psikologis anak yang tumbuh tanpa ibu dan bagaimana mengatasinya? Simak pembahasannya di sini.</p>",
        postCover: "",
        tags: [postHelper.tagsId[0], postHelper.tagsId[1]],
      };

      agent
        .post("/posts")
        .send(body)
        .end((err, res) => {
          res.should.have.status(200);
          res.body.should.be.a("object");
          res.body.should.have
            .property("message")
            .eql("Successfully creating post!");
          res.body.should.have.property("data");
          res.body.data.should.have
            .property("slug")
            .match(/^dampak-psikologis-anak-tanpa-ibu-dan-cara-mengatasinya-/);
          done();
        });
    });

    it("should POST even if no tags are provided", (done) => {
      const body = {
        postTitle: "5 Ide Menciptakan Area Hobi di Rumah",
        postContent:
          "<p>Berada di rumah terlalu lama bisa menyebabkan rasa bosan dan jenuh. Untuk mengatasinya, Anda dapat mengelola rasa jenuh dengan melakukan hobi selama di rumah.</p>",
        postCover: "",
        tags: [],
      };

      agent
        .post("/posts")
        .send(body)
        .end((err, res) => {
          res.should.have.status(200);
          res.body.should.be.a("object");
          res.body.should.have
            .property("message")
            .eql("Successfully creating post!");
          res.body.should.have.property("data");
          res.body.data.should.have
            .property("slug")
            .match(/^5-ide-menciptakan-area-hobi-di-rumah-/);
          done();
        });
    });

    it("should not POST if title is not provided", (done) => {
      const body = {
        postTitle: "",
        postContent:
          "<p>Berada di rumah terlalu lama bisa menyebabkan rasa bosan dan jenuh. Untuk mengatasinya, Anda dapat mengelola rasa jenuh dengan melakukan hobi selama di rumah.</p>",
        postCover: "",
        tags: [],
      };

      agent
        .post("/posts")
        .send(body)
        .end((err, res) => {
          res.should.have.status(400);
          res.body.should.be.a("object");
          res.body.errors[0].should.have
            .property("msg")
            .eql("Invalid value");
          done();
        });
    });

    it("should not POST if content is not provided", (done) => {
      const body = {
        postTitle: "5 Ide Menciptakan Area Hobi di Rumah",
        postContent: "",
        postCover: "",
        tags: [],
      };

      agent
        .post("/posts")
        .send(body)
        .end((err, res) => {
          res.should.have.status(400);
          res.body.should.be.a("object");
          res.body.errors[0].should.have
            .property("msg")
            .eql("Invalid value");
          done();
        });
    });

    it("should not POST if cover is not in base64 format", (done) => {
      const body = {
        postTitle: "5 Ide Menciptakan Area Hobi di Rumah",
        postContent: "<p>Berada di rumah terlalu lama bisa menyebabkan rasa bosan dan jenuh. Untuk mengatasinya, Anda dapat mengelola rasa jenuh dengan melakukan hobi selama di rumah.</p>",
        postCover: "what?",
        tags: [],
      };

      agent
        .post("/posts")
        .send(body)
        .end((err, res) => {
          res.should.have.status(400);
          res.body.should.be.a("object");
          res.body.errors[0].should.have
            .property("msg")
            .eql("Invalid value");
          done();
        });
    });
  });
});
